import { useState } from "react";
import { Box, TextField, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from "@mui/material";
import axios from "axios";

const endpointMapping = {
  Notion: "notion",
  Airtable: "airtable",
};

export const DataForm = ({ integrationType, credentials }) => {
  const [loadedData, setLoadedData] = useState(null);
  const endpoint = endpointMapping[integrationType];

  const handleLoad = async () => {
    try {
      const formData = new FormData();
      formData.append("credentials", JSON.stringify(credentials));
      const response = await axios.post(
        `http://localhost:8000/integrations/${endpoint}/load`,
        formData
      );
      const data = response.data;
      setLoadedData(data);
    } catch (e) {
      alert(e?.response?.data?.detail);
    }
  };

  return (
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      flexDirection="column"
      width="100%"
      sx={{ padding: '20px' }}
    >
      <Box display="flex" flexDirection="column" alignItems="center" width="100%" maxWidth="800px" sx={{ mb: 2 }}>
        <Button 
          onClick={handleLoad} 
          sx={{ mt: 2, minWidth: "150px" }} 
          variant="contained"
        >
          Load Data
        </Button>
        <Button
          onClick={() => setLoadedData(null)}
          sx={{ mt: 1, minWidth: "150px" }}
          variant="contained"
        >
          Clear Data
        </Button>
      </Box>

      {loadedData && (
        <Box
          sx={{
            mt: 4,
            width: "100%",
            maxWidth: "800px",
            padding: "10px",
            border: "1px solid #ddd",
            borderRadius: "4px",
            overflowX: "auto",
            mb: 2,
          }}
        >
          <TableContainer>
            <Table aria-label="integration items table">
              <TableHead>
                <TableRow>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Name</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Type</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Parent ID</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Parent Name</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Children</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Creation Time</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Last Modified Time</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Directory</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Drive ID</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Mime Type</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>Delta</TableCell>
                  <TableCell sx={{ fontWeight: 'bold', backgroundColor: '#f5f5f5', borderBottom: '1px solid #ddd' }}>URL</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {loadedData.map((item, index) => (
                  <TableRow key={index}>
                    <TableCell>{item.name || "N/A"}</TableCell>
                    <TableCell>{item.type || "N/A"}</TableCell>
                    <TableCell>{item.parent_id || "N/A"}</TableCell>
                    <TableCell>{item.parent_path_or_name || "N/A"}</TableCell>
                    <TableCell>{item.children || "None"}</TableCell>
                    <TableCell>{item.creation_time || "N/A"}</TableCell>
                    <TableCell>{item.last_modified_time || "N/A"}</TableCell>
                    <TableCell>{item.directory ? "Yes" : "No"}</TableCell>
                    <TableCell>{item.drive_id || "N/A"}</TableCell>
                    <TableCell>{item.mime_type || "N/A"}</TableCell>
                    <TableCell>{item.delta || "N/A"}</TableCell>
                    <TableCell>{item.url || "N/A"}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Box>
      )}

      <Box
        sx={{
          width: "100%",
          maxWidth: "800px",
          padding: "10px",
          border: "1px solid #ddd",
          borderRadius: "4px",
          overflowX: "auto",
        }}
      >

        <TextField
          label="Json"
          value={loadedData ? JSON.stringify(loadedData, null, 2) : ""}
          sx={{ mt: 2 }}
          InputLabelProps={{ shrink: true }}
          disabled
          multiline
          fullWidth
          minRows={6}
          variant="outlined"
        />
      </Box>
    </Box>
  );
};
